insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 10, 387, '정말 사진 찍으러 가기 좋은 곳!', '너무나도 예쁜 색감의 바다가 있는 곳이 바로 속초! 아름다운 푸른빛의 천진해변, 그리고 아바이마을의 잔잔하고 작은 바닷가까지, 뿐만 아니라 물회부터 아바이순대까지 먹고 와야 할 음식들도 많다는 거~ 올여름 휴양지는 속초로 떠나보는 게 어때?', '2020-02-16', 'Y', 3);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 11, 85, '바다도 좋지만 목장은 더 좋았던 강릉', '강원도의 대표 여행지인 강릉은 볼거리가 참 많은 곳이라 이미 다녀온 사람들도 많겠지? 액자 프레임에 갇힌 듯한 예쁜 사진을 찍을 수 있는 강문해변을 비롯한 예쁜 바다들도 참 많고, 꼭 들러야 하는 목장도 있으니 올여름은 강릉의 숨은 곳까지 여행해보자!', '2020-03-06', 'N', 7);
