insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 26, 359, '좋아서 세 번이나 다녀온 원주', '요즘 스멀스멀 떠오르고 있는 인제의 자작나무 숲! 곧게 서있는 하얀 나무들 사이에 있으면 이게 진정한 힐링! 숲 속의 아카시아 향기도 좋다구. 또 야생화들이 가득한 곰배령 트래킹도 인제의 빠질 수 없는 코스 중 하나지. 뷰가 너무 멋지기로 유명하니까 인제에 들른다면 꼭 방문하기를 추천!', '2020-04-24', 'Y', 0);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 27, 416, '뚜벅이에게 최고의 여행지!', '요즘 스멀스멀 떠오르고 있는 인제의 자작나무 숲! 곧게 서있는 하얀 나무들 사이에 있으면 이게 진정한 힐링! 숲 속의 아카시아 향기도 좋다구. 또 야생화들이 가득한 곰배령 트래킹도 인제의 빠질 수 없는 코스 중 하나지. 뷰가 너무 멋지기로 유명하니까 인제에 들른다면 꼭 방문하기를 추천!', '2020-04-13', 'N', 3);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 28, 375, '좋아서 세 번이나 다녀온 원주', '강원도의 대표 여행지인 강릉은 볼거리가 참 많은 곳이라 이미 다녀온 사람들도 많겠지? 액자 프레임에 갇힌 듯한 예쁜 사진을 찍을 수 있는 강문해변을 비롯한 예쁜 바다들도 참 많고, 꼭 들러야 하는 목장도 있으니 올여름은 강릉의 숨은 곳까지 여행해보자!', '2020-04-23', 'N', 2);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 29, 61, '뚜벅이에게 최고의 여행지!', '태백은 한창 뜨거웠던 드라마 태양의 후예 촬영지로도 유명하지만 그전부터 아름다운 곳이었어. 드라마 용팔이를 포함해 많은 곳에 노출된 적 있는 바람의 언덕은 강릉의 목장만큼이나 예쁘지! 또 여름이면 해바라기 축제가 열려 노란색으로 물드는 구와우마을도 꼭 가보자!', '2020-05-09', 'N', 4);
