insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 43, 15, '생각보다 한적했던 춘천', '한반도 지형으로 유명한 영월은 다들 지리 교과서에서 한 번쯤은 봤을 거야. 스카이워크에서 내려다보는 뷰도 아름답지만 요즘에는 한반도 지형을 보며 내려갈 수 있는 짚라인도 생겼고, 또 패러글라이딩을 할 수도 있어! 패러글라이딩은 별마루 천문대에서 잘 보이니까 구경해도 좋을 거야~', '2020-06-22', 'N', 6);
