insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 50, 138, '정말 사진 찍으러 가기 좋은 곳!', '너무나도 예쁜 색감의 바다가 있는 곳이 바로 속초! 아름다운 푸른빛의 천진해변, 그리고 아바이마을의 잔잔하고 작은 바닷가까지, 뿐만 아니라 물회부터 아바이순대까지 먹고 와야 할 음식들도 많다는 거~ 올여름 휴양지는 속초로 떠나보는 게 어때?', '2020-07-19', 'Y', 2);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 51, 323, '바다도 좋지만 목장은 더 좋았던 강릉', '요즘 스멀스멀 떠오르고 있는 인제의 자작나무 숲! 곧게 서있는 하얀 나무들 사이에 있으면 이게 진정한 힐링! 숲 속의 아카시아 향기도 좋다구. 또 야생화들이 가득한 곰배령 트래킹도 인제의 빠질 수 없는 코스 중 하나지. 뷰가 너무 멋지기로 유명하니까 인제에 들른다면 꼭 방문하기를 추천!', '2020-07-18', 'N', 9);
