insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 56, 47, '뚜벅이에게 최고의 여행지!', '한국의 나폴리라고 불리는 삼척의 장호항은 바다가 워낙 맑고 투명해서 스노클링도 가능하다고 하지! 또 장미 축제는 얼마 전에 끝났지만 삼척 장미공원에서 색색의 예쁜 장미들을 볼 수 있어. 생각보다 큰 규모에 놀란다고 하더라!', '2020-08-12', 'N', 7);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 57, 411, '정말 사진 찍으러 가기 좋은 곳!', '한반도 지형으로 유명한 영월은 다들 지리 교과서에서 한 번쯤은 봤을 거야. 스카이워크에서 내려다보는 뷰도 아름답지만 요즘에는 한반도 지형을 보며 내려갈 수 있는 짚라인도 생겼고, 또 패러글라이딩을 할 수도 있어! 패러글라이딩은 별마루 천문대에서 잘 보이니까 구경해도 좋을 거야~', '2020-08-19', 'Y', 9);
