insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 73, 310, '정말 사진 찍으러 가기 좋은 곳!', '춘천은 남이섬으로 알려지기 시작해서 지금은 사진 찍기 좋은 근교 여행지로 유명하지? 산토리니 카페와 빈티지한 육림랜드, 또 유럽을 떠오르게 하는 제이드가든까지! 가까운 게 최고 장점인 춘천이니까 언제든지 가볍게 다녀오기 좋을 거야!', '2020-09-15', 'N', 4);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 74, 64, '정말 사진 찍으러 가기 좋은 곳!', '강원도의 대표 여행지인 강릉은 볼거리가 참 많은 곳이라 이미 다녀온 사람들도 많겠지? 액자 프레임에 갇힌 듯한 예쁜 사진을 찍을 수 있는 강문해변을 비롯한 예쁜 바다들도 참 많고, 꼭 들러야 하는 목장도 있으니 올여름은 강릉의 숨은 곳까지 여행해보자!', '2020-10-17', 'N', 3);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 75, 189, '푸른 바다를 어디에서나 볼 수 있었던 통영', '강원도의 대표 여행지인 강릉은 볼거리가 참 많은 곳이라 이미 다녀온 사람들도 많겠지? 액자 프레임에 갇힌 듯한 예쁜 사진을 찍을 수 있는 강문해변을 비롯한 예쁜 바다들도 참 많고, 꼭 들러야 하는 목장도 있으니 올여름은 강릉의 숨은 곳까지 여행해보자!', '2020-10-21', 'N', 2);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 76, 289, '정말 사진 찍으러 가기 좋은 곳!', '태백은 한창 뜨거웠던 드라마 태양의 후예 촬영지로도 유명하지만 그전부터 아름다운 곳이었어. 드라마 용팔이를 포함해 많은 곳에 노출된 적 있는 바람의 언덕은 강릉의 목장만큼이나 예쁘지! 또 여름이면 해바라기 축제가 열려 노란색으로 물드는 구와우마을도 꼭 가보자!', '2020-10-21', 'Y', 2);
