insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 96, 237, '정말 사진 찍으러 가기 좋은 곳!', '요즘 스멀스멀 떠오르고 있는 인제의 자작나무 숲! 곧게 서있는 하얀 나무들 사이에 있으면 이게 진정한 힐링! 숲 속의 아카시아 향기도 좋다구. 또 야생화들이 가득한 곰배령 트래킹도 인제의 빠질 수 없는 코스 중 하나지. 뷰가 너무 멋지기로 유명하니까 인제에 들른다면 꼭 방문하기를 추천!', '2020-12-06', 'Y', 6);
insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 97, 497, '바다도 좋지만 목장은 더 좋았던 강릉', '강원도의 대표 여행지인 강릉은 볼거리가 참 많은 곳이라 이미 다녀온 사람들도 많겠지? 액자 프레임에 갇힌 듯한 예쁜 사진을 찍을 수 있는 강문해변을 비롯한 예쁜 바다들도 참 많고, 꼭 들러야 하는 목장도 있으니 올여름은 강릉의 숨은 곳까지 여행해보자!', '2020-12-07', 'N', 4);
