insert into tblMyTour (seq, tourPlanSeq, userSeq, title,  contents, writeDate, allowSharing, thumbsUp) values(seqMyTour.nextVal, 99, 309, '생각보다 한적했던 춘천', '춘천은 남이섬으로 알려지기 시작해서 지금은 사진 찍기 좋은 근교 여행지로 유명하지? 산토리니 카페와 빈티지한 육림랜드, 또 유럽을 떠오르게 하는 제이드가든까지! 가까운 게 최고 장점인 춘천이니까 언제든지 가볍게 다녀오기 좋을 거야!', '2020-12-09', 'N', 1);
